import { Routes, Route } from "react-router-dom";
import Bookings from "./pages/Bookings";
import Home from "./pages/Home";
import "./style.css";


function App() {
  return (
    <div className="App">
      <Routes>
        <Route
          path="/"
          element={() => {
            return (
              <div>
                <HomeHoc>
                  <Home />
                </HomeHoc>
              </div>
            );
          }}
        ></Route>
        <Route
          path="/bookings"
          element={() => {
            return (
              <div>
                <Homehoc>
                  <Bookings />
                </Homehoc>
              </div>
            );
          }}
        ></Route>
      </Routes>
    </div>
  );
}

export default App;
